fun findByPattern(pattern:String,source:String){
    //用正则式匹配文本获取匹配器
    val matcher = Pattern.compile(pattern).matcher(source)
    var templateStr = "    /**%s*/ public static final String EVENT_%s = \"%s\";";
    while (matcher.find()) { //匹配器进行匹配
//        System.out.println(matcher.group()) //打印元文本信息
//        System.out.println(matcher.group(1)) //打印匹配到的信息
//        System.out.println(matcher.group(2)) //打印匹配到的信息
        val key = matcher.group(1);
        val name = matcher.group(3);
        println(String.format(templateStr,name,key.toUpperCase(),key))

    }
}